import React, { Component, Fragment } from "react";
import "./BlogPost.css";
import Post from "../../components/Post/Post";

class BlogPost extends Component {
  render() {
    return (
      <Fragment>
        <p className="setion-title">Blog Post</p>
        <post title="Judul" desc="Isi" />
      </Fragment>
    );
  }
}
